import React from 'react';

const Nav = () => {
    return (
<nav className="navbar navbar-expand-lg navbar-light bg-light w-100">
  <a className="navbar-brand " href="#"><h4 className="my-2" href="/members">Stock App</h4></a>
    <button id="hamburger" className="navbar-toggler second-button" type="button" data-toggle="collapse" data-target="#menu-links" aria-controls="menu-links" aria-expanded="false" aria-label="Toggle navigation">
      <div className="animated-icon2">
          <span></span>
          <span></span>
          <span></span>
          <span></span>
      </div>
    </button>
  <div className="collapse navbar-collapse justify-content-end" id="menu-links">
    <div className="navbar-nav">
      <a className="nav-item nav-link mr-4" href="/members"><p><i className="fas fa-home pr-2"></i>Home</p></a>
      <a className="nav-item nav-link mr-4" href="/study"><p><i className="fas fa-graduation-cap pr-2"></i>Study Mode</p></a>
      <a className="nav-item nav-link mr-4" href="/metrics"><p><i className="fas fa-chart-line pr-2"></i>Metrics</p></a>
      <a className="nav-item nav-link" href="/logout"><p><i className="fas fa-sign-out-alt pr-2"></i>Sign Out</p></a>
    </div>
  </div>
</nav>
    );
};

export default Nav;
